"description": "These water bottle labels were inspired by Honey Jack. They are a great addition to a milestone birthday! We will send you a digital file and you simply print and adhere them to your water bottle labels. \r\n\r\nSupplies you need: \r\nPaper\r\nPrinter\r\nRuler and X-acto knife OR scissors\r\nTape\r\n\r\n1. Once you download the file, print out as many labels as you need on paper then trim. Each label is approximately 10.46&quot; wide x 1&quot; high. It&#39;s easiest to use a ruler and X-acto knife and trim along the edges. Trim off excess paper off the ends, if needed. \r\n\r\n2. Simply remove the paper labels from your water bottles and wrap the personalized label around it. Tape into place. Careful not to put these directly into ice as the labels will be ruined. \r\n\r\nNote: this is a digital file only and you will receive a PDF file to print from. Nothing will be mailed to you. \r\n\r\nTo customize, please send us a message. It will take 48 hours to personalize your purchase and email the final file to you. You will need Adobe Acrobat to open and print any file. Note that work cannot begin on personalization until all information is received and item is paid in full. \r\n\r\nAny product names referenced on this shop are trademarked and property of the trademark owner.",
