"digital_sale_message": "Thanks so much for your order!\r\n\r\nDownload and print this PDF using your own printer. NO PRINTED MATERIALS will be shipped. You may print as many as you need! For personal use only.  \r\n\r\n• • • • • • • • • • • • • • • • • • • • • \r\nprinting & assembly\r\n• • • • • • • • • • • • • • • • • • • • • \r\n\r\n1. DOWNLOAD\r\nDownload the PDF(s) to your computer or flash drive. You will need Adobe Reader to open and print the file. If you don&#39;t have Adobe Reader, you can download it for free at http://get.adobe.com/reader/otherversions/\r\n2. PRINT\r\nThis printable is set up to print on 8.5 x 11 paper so it can easily be printed on your home color printer or taken to your local copy center. Print on card stock, photo paper or water resistant paper. IMPORTANT: when printing, make sure to print &quot;ACTUAL SIZE&quot; instead of &quot;PRINT TO PAGE&quot; so your printable prints at the correct size. For best results, refer to your printer&#39;s manual for the recommended brand of card stock or photo paper to use.\r\n3. CUT\r\nCut out the design template using scissors or a craft punch. Refer to the product description for full details on how to best cut out this printable.\r\n4. ASSEMBLE\r\nThis printable may require some assembly. Refer to the product description for full details on how to best assemble the .\r\n5. be creative\r\nPersonalize this printable with your own flair using glitter and other embellishments.  \r\n\r\n• • • • • • • • • • • • • • • • • • • • • \r\ncopyright info\r\n• • • • • • • • • • • • • • • • • • • • • \r\n\r\nPDF Downloads: You have the printing rights and can print as many as you want from home, at a local print shop or by uploading the file to an online printing service. \r\n\r\nPLEASE NOTE: This design is for personal use only. You may not forward, share, sell or distribute the file. It is for non-commercial use only. © simplified celebrations. All Rights Reserved.",
