"announcement": "Sipdark was created by two friends who have a passion for making the finer things in life, better.\r\n\r\nFine beverages can be enjoyed at some of life’s greatest moments and adventures.  It is our mission to help maximize your enjoyment with design conscious beverage accessories.\r\n\r\nOur initial products are focused on chilling whiskey and scotch with traditional whiskey stones and stainless steel stones.  Store these stones in the freezer and add them to your whiskey or scotch to provide a chill without diluting, as an ice cube would.  We bring a unique option to the industry by offering the ability to have your stones custom engraved with a logo or initials of your choosing.\r\n\r\nAt Sipdark we are constantly designing and will be releasing new chilling devices later this fall. Make sure to check back with us!\r\n\r\nLocated in Chaska, Mn\r\n\r\nYou can visit us at www.sipdark.com !",
