"title": "feel good prints",
"announcement": "All orders ship 1-3 days from ordering and orders within the US usually take 2-5 business days once shipped. Most listings have more than one color option listed, if you don&#39;t see a color you like I am happy to change the colors on any print or make two or more prints match. Just send me a message with what you are looking for! If you have any questions or are interested in customizing a print message me on here or email me at eatsaylove[at]gmail.com. \r\n\r\nAll prints are printed with hi-definition inks on high quality matte paper for vivid prints that will last. All prints are sold as just prints, no frames or mattes are included or offered.\r\n\r\nBlog - www.eatsaylove.blogspot.com\r\nTwitter @eatsaylove\r\nPinterest - www.pinterest.com/ashley_lib\r\nInstagram - @eatsaylove\r\n\r\nCheck out my shop policies for more detailed information, otherwise please feel free to contact me with any questions you might have. I am more than happy to help you with anything you may need.\r\n\r\n******************************************\r\n\r\nAll artwork and content © 2014 Eat.Say.Love.",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you so much for choosing EAT.SAY.LOVE! Your order will be ready to ship in 1-3 business days. Also please make sure to check your inbox after ordering in case I have any questions about your order.\r\n\r\nAll DOMESTIC orders are shipped USPS First Class which usually takes 2-5 BUSINESS DAYS. Once your order is ready to go out you will receive an email confirmation along with your tracking information. I apologize if things take longer than expected in transit, once things leave my hands they are out of my control. \r\n\r\nAll INTERNATIONAL orders are shipped via USPS as well. Unfortunately tracking is unavailable for these orders. Orders can take anywhere from 1-3 weeks. Once your order is ready to go out you will receive an email confirmation along with your customs number. I thank you in advance for your patience. \r\n\r\nIf you have any questions please feel free to contact me. \r\n\r\nThanks again, \r\nAshley",
"digital_sale_message": null,
"last_updated_tsz": 1412704825,
"listing_active_count": 65,
"login_name": "ashleylib",
"accepts_custom_requests": true,
"policy_welcome": "Thank you for shopping EAT.SAY.LOVE! We offer playful prints for your home to make you smile. No matter our differences we all eat, talk, and love somebody or something! Most of my prints are about food, love, or a quote.\r\n\r\nPlease message me if you are looking for a custom item, I am happy to work with you to get you exactly what you want, however I kindly request that you are serious about purchasing. \r\n\r\nIf you have any questions you can contact me using the Etsy conversation feature. Remember to check your inbox for my reply! ",
"policy_payment": "I accept direct check-outs (debit/credit card), Etsy gift cards, & PayPal. \r\nMA orders are subject to 6.25% sales tax.",
"policy_shipping": "WHEN WILL PRINTS SHIP?\r\nALL prints are shipped using USPS First Class Mail within 1-3 days of receiving your order UNLESS otherwise specified in the listing or shop announcement. Please check this before ordering.\r\n\r\nHOW ARE PRINTS PACKAGED?\r\n8x10 prints - Are packaged in protective cellophane sleeves flat in a 100% recycled rigid mailer. \r\n11x14 prints - Are packaged the same way along with a double thick backing board.\r\n\r\n--- PLEASE KINDLY RECYCLE! ---\r\n\r\nWHERE ARE THEY SHIPPED?\r\nPrints are shipped right to you unless otherwise specified. Please let me know if a print(s) is(are) being sent as a gift! Please be aware that if large prints (11x14s) cannot be left in a mailbox, USPS may leave a slip in its place and you will have to get your order from the post office. I apologize for any inconvenience this may cause.\r\n\r\nUNITED STATES/DOMESTIC ORDERS - Once shipped you will receive an email notifying you along with tracking information. Usually prints take 2-5 business days to arrive. If things take longer I apologize, once things leave my hands they are out of my control.\r\n\r\nINTERNATIONAL ORDERS - Once shipped you will receive an email notifying you along with customs number. Orders can take anywhere from 1-3 weeks to arrive once shipped. You are responsible for any duties, customs, and taxes levied by your country. Please check with your Customs office and/or Postal Service if you are concerned about possible taxes. \r\n\r\nTRACKING\r\nIncluded on all US orders - you will receive a tracking number when you receive your email confirming your print has been shipped. International orders have delivery confirmation.\r\n\r\nGIFTS\r\nIf your order is a gift for someone please make note of it in the message to seller box at checkout or contact me to let me know. I do not include receipts in ANY packages unless otherwise specified. Please let me know if you would like a gift receipt or a short hand written message included.\r\n\r\nLOST ORDERS\r\nWhile extremely rare, if a package ends up missing along it&#39;s travels to you, I am happy to send a replacement! Because mail can be delayed for a variety of reasons, I will wait 3 weeks from the original ship date of the first package for US orders, and 5 weeks for International orders before sending a replacement. Please let me know if you do not receive your package in that amount of time, otherwise I will assume you received your print(s).\r\n\r\nDAMAGED PRINTS\r\nI ship using rigid mailers to make sure that prints do not bend in transit. All envelops are also marked DO NOT BEND, however sometimes on rare occasions the post office or mail carrier can get a little rough. PLEASE let me know RIGHT AWAY when you get your print if it bent or damaged. I will have no idea otherwise and will assume all is well if I do not hear otherwise :)\r\n\r\nAny other problems please contact me via Etsy convo or email eatsaylove@gmail.com",
"policy_refunds": "EAT.SAY.LOVE. prints are made using high quality, long lasting materials and are carefully packaged and shipped. \r\n\r\nI do not accept returns simply because every thing is made to order. \r\nI also do not offer cash refunds, except under extraordinary circumstances. I offer replacement prints for those lost in the mail or damaged upon arrival. \r\n\r\nPlease contact me if you have ANY problems with your order. ",
"policy_additional": "ALL prints come unframed, at this time I do not offer any framing options. Prints are trimmed to size and ready to put in your frame of choice. \r\n\r\nAll prints are property and copyright of Eat.Say.Love. Images may not be reproduced, resold, or used in any form without written consent. By purchasing any item in the shop you agree to my shop policies.\r\n\r\nColor(s) on prints may differ somewhat due to the variations in computer monitors when viewing the prints online versus the actual print.",
