"policy_shipping": "When Can I Expect My Glasses?\r\n\r\nThe lead times listed on each product page are approximate. We do our best to complete your order within 10 business days (not including weekends and standard holidays). That is the production time needed for us to hand-craft your custom glass barware...not inclusive of time in transit to ship to your location. When your order ships, you will receive an email with the tracking number. Depending on your location, it can take anywhere from 2-5 days for the product to then arrive at your door. If you are concerned about our lead times and have a deadline for receiving, consider contacting us to inquire about our current lead times PRIOR to placing your order.\r\n",
"policy_refunds": "Custom Products\r\n\r\nThe glasses offered in our boutique are not found in your average store and are custom-made and hand-crafted by skilled artisans specifically for you. Therefore our custom glassware is not returnable. Orders for all custom items cannot be canceled once placed. Our personalized, custom made items require payment in full upon order and cannot be returned. If you wish to cancel a custom order, you may attempt to do so within 8 hours of your original order time. We will check the status of production immediately to attempt to stop production of your customized item. If our artisans have already begun production, we will not be able to stop your order. We will notify you immediately of the situation.\r\n\r\n\r\nDamaged or Defective Items\r\n\r\nPlease take time to inspect all items carefully- immediately upon receipt- for any damage that may have occurred in transit. Contact us immediately (within 2 business days of receipt of your goods) of any damage. Please keep all packaging materials in case the shipper needs to inspect the package during their claims process. We reserve the right to require a photograph of broken or damaged items when a claim is filed prior to replacing any damaged or defective items. If for any reason your custom item does not arrive with the specifications that you selected when ordering (for example the artisan misspelled a name), we reserve the right to replace and ship the replacement item at no additional charge to you. Any claim for damaged items, defective or incorrect items must be made within 2 business days. Any claims made after 2 business days will not be accepted, and therefore, are unable to be replaced.\r\n\r\n",
