"announcement": "Handcrafted unique gemstone earrings, necklaces and bracelets. Precious, semi precious gemstones & pearls in 14k gold filled, sterling silver & 14k rose gold filled. Custom orders welcome. Bridal party orders discount available. \r\nCalico Juno Design also features an exciting assortment of interchangeable pendants and gemstones that allow you to create a look that is truly unique. So whether you are a bride, looking for that special gift or shopping for unique statement jewelry for yourself you will be sure to find something you love browsing over 1700 unique jewelry pieces!\r\n\r\n\r\n\r\n",
