"sale_message": "Thank you for shopping with Calico Juno Designs! \r\n\r\nWe would greatly appreciate your feedback once you receive your jewelry!\r\n\r\nEarn 10% off your next order if you send us an &quot;appreciation photo&quot; \r\nAppreciation photos are a great way to show off the item you&#39;ve purchased!",
