"login_name": "CalicoJunoJewelry",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to Calico Juno Designs! \r\n\r\nWith a vast array of selections you can add our unique designs to any outfit for any occasion. Because  all of our pieces are handmade & made to order we can customize a design to your specifications and bring it to you with a promise of outstanding quality, service and value.  \r\nFeaturing over 1,700 designs all of our jewelry has no pre-made or fabricated parts. All gemstones and beads are wrapped individually by hand, and we even make our own hoops, french wires & clasps.  Precious and semi-precious gemstones, Austrian crystals, freshwater pearls, and other stones are used in combination to create a wonderful palette of colors to create original designs.\r\n\r\nAll designs can now be made in solid 14k gold.\r\nEmail us at CalicoJuno@gmail.com for price quotes or any questions you may have.\r\n\r\n**Custom Orders** - Any design can be modified to accomodate your bridal or prom look. Send us any pictures or material swatches to match stones. *NO RETURNS OR EXCHANGES ON CUSTOM ORDERS*\r\n\r\nAll bridal party orders of 5 or more of the same style will receive 15% off! \r\n\r\nJewelry is made to order, so please allow 2-3 days before shipping. \r\n\r\nJewelry is sent securely packaged via USPS first class mail. All US orders come with tracking. Shipping upgrades are available, please inquire.\r\n \r\nWhile we strive to make all the jewelry the same each time, and to look the same as what you see on our site, sometimes due to the nature of the stones and what we have in stock (shading of color, size, shape, faceting, inclusions, etc.), this isn&#39;t always possible.  Please understand that sometimes we may have to substitute a stone or use something slightly different.\r\n\r\nGemstones, Pearls, Stones, and Crystals: \r\n\r\nAll gemstones, pearls, and crystals used by Calico Juno Designs are carefully selected to assure that high-quality stones are used. \r\n \r\nCARE AND CLEANING OF YOUR JEWELRY\r\n\r\n(Turquoise, coral, and other porous stones are not recommended to be placed in cleaning solutions).\r\n\r\nGold - while gold-filled jewelry does not tarnish as does sterling silver, occasionally it can be cleaned/polished (the same way as regular 14k gold) using warm soapy water and an old toothbrush. Or, you can use a commercial liquid gold cleaner.\r\n\r\nSterling silver needs to be cleaned often to keep it bright and shiny, as it will tarnish and become dull and dingy looking, eventually oxidizing and turning almost black (unless you want it to look blackened). You can just dunk your jewelry in the liquid, swish it around for about 5-7 seconds and pull it out...any longer may damage stones!!! Keeping your sterling silver jewelry protected in a jewelry box or commercial jewelry bags infused with anti-tarnishing agents will help slow down the tarnishing. \r\nRinse with warm running water and dry with a paper towel (NOT a cloth or terry cloth towel, as it may snag!), and your jewelry will look bright and shiny again.\r\n\r\nAll Calico Juno Designs jewelry should be handled with care, as it is delicate. If it does snag on something, do not pull at the jewelry as it may stretch it out of shape. Gently hold the jewelry and try loosening the snagged item instead.\r\n\r\nWhile not being worn, the jewelry should be carefully stored in separate quarters away from other jewelry, to keep it from getting tangled. Optimally it should be hung up on special displays designed for hanging jewelry",
"policy_payment": "We currently accept PayPal and it&#39;s a secured way of payment. \r\n\r\n**We are now offering a 30 day layaway plan for all orders under $200. Orders over $200 we offer a 60 day layaway plan**You can reserve an item by putting down a 50% deposit and paying the remainder of the balance within the allotted time stated above** \r\nPlease contact us so we can set it up for you.",
"policy_shipping": "Shipping for all U.S. order is $3 vis USPS First Class Mail with tracking. If you need to upgrade the shipping method please contact us for a quote. \r\n\r\nPlease make sure you are verified through PayPal and the shipping information is correct.",
